    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service Service
    proposes to issue a rightofway ROW permit to authorize continuation of a communications
    tower and parabolic antennas in the Swanson River Oil Field on Kenai National Wildlife
    Refuge. The Environmental Assessment EA attached to this document analyzes the consequences
    of five alternatives. We chose the proposed action over the other alternatives.
    This Finding of No Significant Impact FONSI documents our conclusion that the proposed
    action will not have any significant impacts on the quality of the human environment.",nt"license_title":
